import React, {useEffect, useState} from 'react'

function App() {
  const [chistes, setChistes] = useState();

  const url = 'api icndb.com/jokes/';
  const peticion = fetch(url);

  useEffect(() => {
    peticion
    .then(response => response.json())
    .then(data => setChistes(chistes.append(data.value.joke, data.value.id)));
    console.log(chistes);
  }, []);

  return (
    <>

    </>
  )
}

